meta.script:
if ( screen.width >= 768 && screen.width <= 1136 ) {
	var ratio = Math.round( screen.width / 13 ) / 100;
	document.getElementById( "viewport" ).setAttribute( "content", "width=1300, initial-scale=" + ratio );
}

div.script:
